ages are available and enabled, the text on your site interface may be translated, registered users may select their preferred language on the <em>My account</em> page, and site authors may indicate a specific language when creating posts. The site\'s default language is used for anonymous visitors and for users who have not selected a preferred language.','6.26'),(173,'/admin/settings/language','default','For each language available on the site, use the <em>edit</em> link to configure language details, including name, an optional language-specific path or domain, and whether the language is natively presented either left-to-right or right-to-left. These languages also appear in the <em>Language</em> selection when creating a post of a content type with multilingual support.','6.26'),(174,'/admin/settings/language','default','Use the <a href=\"@add-language\">add language page</a> to enable additional languages (and automatically import files from a translation package, if available), the <a href=\"@search\">translate interface page</a> to locate strings for manual translation, or the <a href=\"@import\">import page</a> to add translations from individual <em>.po</em> files. A number of contributed translation packages containing <em>.po</em> files are available on the <a href=\"@translations\">Drupal.org translations page</a>.','6.26'),(175,'/admin/settings/language','default','Drupal core update status','6.26'),(176,'/admin/settings/language','default','No update data available','6.26'),(177,'/admin/settings/language','default','No information is available about potential new releases for currently installed modules and themes. To check for updates, you may need to <a href=\"@run_cron\">run cron</a> or you can <a href=\"@check_manually\">check manually</a>. Please note that checking for available updates can take a long time, so please be patient.','6.26'),(178,'/admin/settings/language','default','Search this site','6.26'),(179,'/admin/settings/language','default','Enter the terms you wish to search for.','6.26'),(180,'/admin/settings/language','default','!title: !required','6.26'),(181,'/admin/settings/language/configure','default','Language negotiation','6.26'),(182,'/admin/settings/language/configure','default','None.','6.26'),(183,'/admin/settings/language/configure','default','Path prefix only.','6.26'),(184,'/admin/settings/language/configure','default','Path prefix with language fallback.','6.26'),(185,'/admin/settings/language/configure','default','Domain name only.','6.26'),(186,'/admin/settings/language/configure','default','Select the mechanism used to determine your site\'s presentation language. <strong>Modifying this setting may break all incoming URLs and should be used with caution in a production environment.</strong>','6.26'),(187,'/admin/settings/language/configure','default','Save settings','6.26'),(188,'/admin/settings/language/configure','default','Language negotiation settings determine the site\'s presentation language. Available options include:','6.26'),(189,'/admin/settings/language/configure','default','<strong>None.</strong> The default language is used for site presentation, though users may (optionally) select a preferred language on the <em>My Account</em> page. (User language preferences will be used for site e-mails, if available.)','6.26'),(190,'/admin/settings/language/configure','default','<strong>Path prefix only.</strong> The presentation language is determined by examining the path for a language code or other custom string that matches the path prefix (if any) specified for each language. If a suitable prefix is not identified, the default language is used. <em>Example: \"example.com/de/contact\" sets presentation language to German based on the use of \"de\" within the path.</em>','6.26'),(191,'/admin/settings/language/configure','default','<strong>Path prefix with language fallback.</strong> The presentation language is determined by examining the path for a language code or other custom string that matches the path prefix (if any) specified for each language. If a suitable prefix is not identified, the display language is determined by the user\'s language preferences from the <em>My Account</em> page, or by the browser\'s language settings. If a presentation language cannot be determined, the default language is used.','6.26'),(192,'/admin/settings/language/configure','default','<strong>Domain name only.</strong> The presentation language is determined by examining the domain used to access the site, and comparing it to the language domain (if any) specified for each language. If a match is not identified, the default language is used. <em>Example: \"http://de.example.com/contact\" sets presentation language to German based on the use of \"http://de.example.com\" in the domain.</em>','6.26'),(193,'/admin/settings/language/configure','default','The path prefix or domain name for a language may be set by editing the <a href=\"@languages\">available languages</a>. In the absence of an appropriate match, the site is displayed in the <a href=\"@languages\">default language</a>.','6.26'),(194,'/','default','HTML filter','6.26'),(195,'/','default','Line break converter','6.26'),(196,'/','default','URL filter','6.26'),(197,'/','default','HTML corrector','6.26'),(198,'/','default','Taxonomia','6.26'),(199,'/','default','Add new comment','6.26'),(200,'/','default','Add a new comment to this page.','6.26'),(201,'/','default','Thu','6.26'),(202,'/','default','Anonymous','6.26'),(203,'/','default','!datetime  !username','6.26'),(204,'/','default','Read more','6.26'),(205,'/','default','Read the rest of !title.','6.26'),(206,'/','default','RSS','6.26'),(207,'/','default','Syndicate content','6.26'),(208,'/','default',' first','6.26'),(209,'/','default',' previous','6.26'),(210,'/','default','next ','6.26'),(211,'/','default','Go to first page','6.26'),(212,'/','default','Go to previous page','6.26'),(213,'/','default','Go to next page','6.26'),(214,'/','