INSERT INTO `node_type` VALUES ('page','Page','node','A <em>page</em>, similar in form to a <em>story</em>, is a simple method for creating and displaying information that rarely changes, such as an \"About us\" section of a website. By default, a <em>page</em> entry does not allow visitor comments and is not featured on the site\'s initial home page.','',1,'Title',1,'Body',0,1,1,0,'page'),('story','Story','node','A <em>story</em>, similar in form to a <em>page</em>, is ideal for creating and displaying content that informs or engages website visitors. Press releases, site announcements, and informal blog-like entries may all be created with a <em>story</em> entry. By default, a <em>story</em> entry is automatically featured on the site\'s initial home page, and provides the ability to post comments.','',1,'Title',1,'Body',0,1,1,0,'story'),('feed_fast','Fast feed','node','Subscribe to RSS or Atom feeds. Create light weight database records from feed content.','',1,'Title',1,'Body',0,0,0,1,'feed_fast'),('feed','Feed','node','Subscribe to RSS or Atom feeds. Creates nodes of the content type \"Feed item\" from feed content.','',1,'Title',1,'Body',0,0,1,1,'feed'),('feed_item','Feed item','node','This content type is being used for automatically aggregated content from feeds.','',1,'Title',1,'Body',0,0,1,1,'feed_item');
/*!40000 ALTER TABLE `node_type` ENABLE KEYS */;
UNLOCK TABLES;

