 e reforar a produo em lea de balio com o encerramento da linha de produo de santarm para responder  crescente aposta no mercado externo cerca de metade deste montante 60 milhes de euros j tem a garantia de financiamento por parte do banco europeu de investimento bei fonte do grupo liderado por antnio pires de lima confirma ao dirio econmico que se trata de um financiamento cujo processo ainda est a ser contractualizado est integrado no nosso plano de investimentos global para o quadrinio 20112014 que ascende a 173 milhes de euros explica a mesma fonte preferiu no avanar com mais pormenores sobre esta operao no entanto de acordo com informao disponvel no site do bei o processo deu entrada em maro ltimo tendo sido aprovado no passado dia 25 de maio o montante refere o site ter como destino melhorias na rea operacional produo logstica e eficincia ambiental  antnio pires banco europeu banco europeu de investimento bei cerveja super bock dirio econmico grupo cervejeiro grupo cervejeiro garantiu financiamento de 60 milhes junto do banco europeu de investimento impressivemedia gbr santarm super bock unicer  ',0),(3,'node',' core investment banking activities front office edit investment banking corporate finance is the traditional aspect of investment banks which also involves helping customers raise funds in capital markets and giving advice on mergers and acquisitions m a this may involve subscribing investors to a security issuance coordinating with bidders or negotiating with a merger target another term for the investment banking division is corporate finance and its advisory group is often termed mergers and acquisitions a pitch book of financial information is generated to market the bank to a potential m a client if the pitch is successful the bank arranges the deal for the client the investment banking division ibd is generally divided into industry coverage and product coverage groups industry coverage groups focus on a specific industry such as healthcare fig financial institutions group industrials or tmt technology media and telecommunication and maintain relationships with corporations within the industry to bring in business for a bank product coverage groups focus on financial products such as mergers and acquisitions leveraged finance public finance asset finance and leasing structured finance restructuring equity and highgrade debt and generally work and collaborate with industry groups on the more intricate and specialized needs of a client edit sales and trading on behalf of the bank and its clients a large investment bank s primary function is buying and selling products in market making traders will buy and sell financial products with the goal of making money on each trade sales is the term for the investment bank s sales force whose primary job is to call on institutional and highnetworth investors to suggest trading ideas on a caveat emptor basis and take orders sales desks then communicate their clients orders to the appropriate trading desks which can price and execute trades or structure new products that fit a specific need structuring has been a relatively recent activity as derivatives have come into play with highly technical and numerate employees working on creating complex structured products which typically offer much greater margins and returns than underlying cash securities in 2010 investment banks came under pressure as a result of selling complex derivatives contracts to local municipalities in europe and the us 2 strategists advise external as well as internal clients on the strategies that can be adopted in various markets ranging from derivatives to specific industries strategists place companies and industries in a quantitative framework with full consideration of the macroeconomic scene this strategy often affects the way the firm will operate in the market the direction it would like to take in terms of its proprietary and flow positions the suggestions salespersons give to clients as well as the way structurers create new products banks also undertake risk through proprietary trading performed by a special set of traders who do not interface with clients and through principal risk risk undertaken by a trader after he buys or sells a product to a client and does not hedge his total exposure banks seek to maximize profitability for a given amount of risk on their balance sheet the necessity for numerical ability in sales and trading has created jobs for physics mathematics and engineering phds who act as quantitative analysts edit equity research the research division reviews companies and writes reports about their prospects often with buy or sell ratings while the research division may or may not generate revenue based on policies at different banks its resources are used to assist traders in trading the sales force in suggesting ideas to customers and investment bankers by covering their clients research also serves outside clients with investment advice such as institutional investors and high net worth individuals in the hopes that these clients will execute suggested trade ideas through the sales and trading division of the bank and thereby generate revenue for the firm there is a potential conflict of interest between the investment bank and its analysis in that published analysis can affect the bank s profits hence in recent years the relationship between investment banking and research has become highly regulated requiring a chinese wall between public and private functions edit middle office this area of the bank includes risk management treasury management internal controls and corporate strategy risk management involves analyzing the market and credit risk that traders are taking onto the balance sheet in conducting their daily trades and setting limits on the amount of capital that they are able to trade in order to prevent bad trades having a detrimental effect on a desk overall another key middle office role is to ensure that the economic risks are captured accurately as per agreement of commercial terms with the counterparty correctly as per standardized booking models in the most appropriate systems and on time typically within 30 minutes of trade execution in recent years the risk of errors has become known as operational risk and the assurance middle offices provide now includes measures to address this risk when this assurance is not in place market and credit risk analysis can be unreliable and open to deliberate manipulation additionally corporate treasury is responsible for an investment bank s funding capital structure management and liquidity risk monitoring financial control tracks and analyzes the capital flows of the firm the finance division is the principal adviser to senior management on essential areas such as controlling the firm s global risk exposure and the profitability and structure of the firm s various businesses via dedicated trading desk product control teams in the united states and united kingdom a financial controller is a senior position often reporting to the chief financial officer corporate strategy along with risk treasury and controllers also often falls under the finance division edit back office edit operations this involves datachecking trades that have been conducted ensuring that they are not erroneous and transacting the required transfers many banks have outsourced operations it is however a critical part of the bank due to increased competition in finance related careers college degrees are now mandatory at most tier 1 investment banks citation needed a finance degree has proved significant in understanding the depth of the deals and transactions that occur across all the divisions of the bank edit technology every major investment bank has considerable amounts of inhouse software created by the technology team who are also responsible for technical support technology has changed considerably in the last few years as more sales and trading desks are using electronic trading some trades are initiated by complex algorithms for hedging purposes firms are responsible for compliance with government regulations and internal regulations edit other businesses global transaction banking is the division which provides cash management custody services lending and securities brokerage services to institutions prime brokerage with hedge funds has been an especially profitable business as well as risky as seen in the run on the bank with bear stearns in 2008 investment management is the professional management of various securities shares bonds etc and other assets eg real estate to meet specified investment goals for the benefit of investors investors may be institutions insurance companies pension funds corporations etc or private investors both directly via investment contracts and more commonly via collective investment schemes eg mutual funds the investment management division of an investment bank is generally divided into separate groups often known as private wealth management and private client services merchant banking can be called very personal banking merchant banks offer capital in exchange for share ownership rather than loans and offer advice on management and strategy merchant banking is also a name used to describe the private equity side of a firm 3 current examples include defoe fournier cie and jpmorgan s one equity partners and the original jp morgan co rothschilds barings warburgs and morgans were all merchant banks originally merchant bank was the british english term for an investment bank commercial banking see commercial bank edit size of industry global investment banking revenue increased for the fifth year running in 2007 to a record us 843 billion 4 which was up 22 on the previous year and more than double the level in 2003 subsequent to their exposure to united states subprime securities investments many investment banks have experienced losses since this time the united states was the primary source of investment banking income in 2007 with 53 of the total a proportion which has fallen somewhat during the past decade europe with middle east and africa generated 32 of the total slightly up on its 30 share a decade ago citation needed asian countries generated the remaining 15 over the past decade fee income from the us increased by 80 citation needed this compares with a 217 increase in europe and 250 increase in asia during this period citation needed the industry is heavily concentrated in a small number of major financial centers including city of london new york city hong kong and tokyo investment banking is one of the most global industries and is hence continuously challenged to respond to new developments and innovation in the global financial markets new products with higher margins are constantly invented and manufactured by bankers in the hope of winning over clients and developing trading knowhow in new markets however since these can usually not be patented or copyrighted they are very often copied quickly by competing banks pushing down trading margins for example trading bonds and equities for customers is now a commodity business citation needed but structuring and trading derivatives retains higher margins in good times and the risk of large losses in difficult market conditions such as the credit crunch that began in 2007 each overthecounter contract has to be uniquely structured and could involve complex payoff and risk profiles listed option contracts are traded through major exchanges such as the cboe and are almost as commoditized as general equity securities in addition while many products have been commoditized an increasing amount of profit within investment banks has come from proprietary trading where size creates a positive network benefit since the more trades an investment bank does the more it knows about the market flow allowing it to theoretically make better trades and pass on better guidance to clients the fastest growing segment of the investment banking industry are private investments into public companies pipes otherwise known as regulation d or regulation s such transactions are privately negotiated between companies and accredited investors these pipe transactions are nonrule 144a transactions large bulge bracket brokerage firms and smaller boutique firms compete in this sector special purpose acquisition companies spacs or blank check corporations have been created from this industry citation needed edit vertical integration in the us the glass steagall act initially created in the wake of the stock market crash of 1929 prohibited banks from both accepting deposits and underwriting securities and led to segregation of investment banks from commercial banks glass steagall was effectively repealed for many large financial institutions by the gramm leach bliley act in 1999 another development in recent years has been the vertical integration of debt securitization previously investment banks had assisted lenders in raising more lending funds and having the ability to offer longer term fixed interest rates by converting lenders outstanding loans into bonds for example a mortgage lender would make a house loan and then use the investment bank to sell bonds to fund the debt the money from the sale of the bonds can be used to make new loans while the lender accepts loan payments and passes the payments on to the bondholders this process is called securitization however lenders have begun to securitize loans themselves especially in the areas of mortgage loans because of this and because of the fear that this will continue many investment banks have focused on becoming lenders themselves 5 making loans with the goal of securitizing them in fact in the areas of commercial mortgages many investment banks lend at loss leader interest rates citation needed in order to make money securitizing the loans causing them to be a very popular financing option for commercial property investors and developers citation needed securitized house loans may have exacerbated the subprime mortgage crisis beginning in 2007 by making risky loans less apparent to investors edit financial crisis of 20072008 the 2007 financial crisis called into question the business model of the investment bank 6 without the regulation imposed on it by glasssteagall neutrality is disputed once robert rubin a former cochairman of goldman sachs became part of the clinton administration and deregulated banks the previous conservatism of underwriting established companies and seeking longterm gains was replaced by lower standards and shortterm profit 7 formerly the guidelines said that in order to take a company public it had to be in business for a minimum of five years and it had to show profitability for three consecutive years after deregulation those standards were gone but small investors did not grasp the full impact of the change 7 investment banks bear stearns founded in 1923 and lehman brothers over 100 years old collapsed merrill lynch was acquired by bank of america which remained in trouble as did goldman sachs and morgan stanley the ensuing financial crisis of 2008 saw goldman sachs and morgan stanley abandon their status as investment banks by converting themselves into traditional bank holding companies thereby making themselves eligible 6 to receive billions of dollars each in emergency taxpayerfunded assistance 7 by making this change referred to as a technicality banks would be more tightly regulated 6 initially banks received part of a 700 billion troubled asset relief program tarp intended to stabilize the economy and thaw the frozen credit markets 8 eventually taxpayer assistance to banks reached nearly 13 trillion dollars most without much scrutiny 9 lending did not increase 10 and credit markets remained frozen 11 a number of former goldmansachs top executives such as henry paulson and ed liddy moved to highlevel positions in government and oversaw the controversial taxpayerfunded bank bailout 7 the tarp oversight report released by the congressional oversight panel found however that the bailout tended to encourage risky behavior and corrupt ed the fundamental tenets of a market economy 12 the tarp has all but created an expectation if not an emerging sense of entitlement that certain financial and nonfinancial institutions are simply toobigortoointerconnectedtofail and that the government will promptly honor the implicit guarantee issued for the benefit of any such institution that suffers a reversal of fortune this is the enduring legacy of the tarp unfortunately by offering a strong safety net funded with unlimited taxpayer resources the government has encouraged potential recipients of such largess to undertake inappropriately risky behavior secure in the conviction that all profits from their endeavors will inure to their benefit and that large losses will fall to the taxpayers the placement of a government sanctioned thumbonthescales corrupts the fundamental tenets of a market economy the ability to prosper and the ability to fail congressional oversight panel tarp oversight report under threat of a subpoena by senator chuck grassley goldman sachs revealed that through tarp bailout of aig goldman received 129 billion in taxpayer aid some through aig 43 billion of which was then paid out to 32 entities including many overseas banks hedge funds and pensions 13 the same year it received 10 billion in aid from the government it also paid out multimillion dollar bonuses to 603 employees and hundreds more received milliondollar bonuses the total paid in bonuses was 482 billion 1415 morgan stanley received 10 billion in tarp funds and paid out 4475 billion in bonuses of those 428 people received more than a million dollars and of those 189 received more than 2 million 16 edit criticisms the investment banking industry and many individual investment banks have come under criticism for a variety of reasons including perceived conflicts of interest overly large pay packages cartellike or oligopolic behavior taking both sides in transactions and more 17 edit conflicts of interest conflicts of interest may arise between different parts of a bank creating the potential for market manipulation according to critics authorities that regulate investment banking the fsa in the united kingdom and the sec in the united states require that banks impose a chinese wall to prevent communication between investment banking on one side and equity research and trading on the other critics say such a barrier does not always exist in practice however conflicts of interest often arise in relation to investment banks equity research units which have long been part of the industry a common practice is for equity analysts to initiate coverage of a company in order to develop relationships that lead to highly profitable investment banking business in the 1990s many equity researchers allegedly traded positive stock ratings for investment banking business alternatively companies may threaten to divert investment banking business to competitors unless their stock was rated favorably laws were passed to criminalize such acts and increased pressure from regulators and a series of lawsuits settlements and prosecutions curbed this business to a large extent following the 2001 stock market tumble after the dot com bubble philip augar author of the greed merchants said in an interview that you cannot simultaneously serve the interest of issuer clients and investing clients and it s not just underwriting and sales investment banks run proprietary trading operations that are also making a profit out of these securities 17 many investment banks also own retail brokerages during the 1990s some retail brokerages sold consumers securities which did not meet their stated risk profile this behavior may have led to investment banking business or even sales of surplus shares during a public offering to keep public perception of the stock favorable since investment banks engage heavily in trading for their own account there is always the temptation for them to engage in some form of front running the illegal practice whereby a broker executes orders for their own account before filling orders previously submitted by their customers there benefiting from any changes in prices induced by those orders investment banking has also been criticised for its opacity 18 edit compensation investment banking is often criticized for the enormous pay packages awarded those who work in the industry according to bloomberg wall street s five biggest firms paid over 3 billion to their executives from 2003 to 2008 while they presided over the packaging and sale of loans that helped bring down the investmentbanking system 19 the highly generous pay packages include 172 million for merril lynch co ceo stanley o neal from 2003 to 2007 before it was bought by bank of america in 2008 and 161 million for bear stearns co s james cayne before the bank collapsed and was sold to jpmorgan chase co in june of 2008 19 such pay arrangements have attracted the ire of democrats and republicans in congress who demanded limits on executive pay in 2008 when the us government was bailing out the industry with a 700 billion financial rescue package 19 writing in the global association of risk professionals aaron brown a vice president at morgan stanley says by any standard of human fairness of course investment bankers make obscene amounts of money 17   bank core investment banking activities corporate finance finance goldman sachs impressivemedia gbr investment bank investment banking investment banks  ',0),(4,'node',' noticias ',0),(5,'node',' tenha acesso a mais informao tornese assinante pblico ',0),(6,'node',' pcp diz que oramento tudo agrava e lembra responsabilidade individual dos deputados o pcp considerou hoje que o oramento de 2013 tudo agrava e estabelece que a austeridade no tem fim sublinhando a responsabilidade individu